Identifikátor licencie, ktorý je globálne unikátnym identifikátorom pre licenciu alebo zmluvu, pod ktorou sú položky generované, predkladané na spracovanie a/alebo platené, ktorý je konštruovaný spájaním:
 - kódu vydávajúcej agentúry ISO/IEC 15459;
 - čísla licencie alebo zmluvy, ktoré zodpovedá špecifikáciám dotknutej vydávajúcej agentúry;
 a ktorý:
 - obsahuje iba veľké abecedné a/alebo číselné znaky;
 - je unikátny (teda sa líši od akéhokoľvek iného identifikátora v súlade s ISO/IEC 15459) v rámci domény vydávajúcej agentúry;
 - nemôže byť odvodený od žiadneho iného identifikátora v súlade s ISO/IEC 15459, vydaného pod rovnakou vydávajúcou agentúrou, jednoduchým pridaním znakov na jeho koniec, alebo ich odstránením z neho.

