Kód lokality '26L', ktorý je kódom identifikujúcim lokalitu alebo geografickú oblasť alebo pridruženú skupinu takýchto lokalít alebo oblastí, ktoré majú význam pre súvisiacu transakciu a ktoré spĺňajú jednu zo štruktúr definovaných v bodoch (a) až (f) nižšie:
a) dva veľké abecedné znaky zodpovedajúce dvojznakovému kódu krajiny ISO 3166-1 alfa krajiny, v ktorej sa nachádzajú alebo z ktorej sa skladajú lokalita(y) alebo oblasť(i);
b) tri veľké abecedné znaky zodpovedajúce kódu IATA letiska alebo mesta, v ktorom sa nachádzajú, sú blízko alebo z ktorého sa skladajú lokalita(y) alebo oblasť(i);
c) štyri alebo viac znakov, z ktorých prvé tri zodpovedajú kódu krajiny ISO 3166-1 nasledované pomlčkou (-), pričom zvyšok je poštové smerovacie číslo v príslušnej krajine;
d) štyri alebo viac znakov, z ktorých prvé tri zodpovedajú kódu krajiny ISO 3166-1 nasledované bodkou (.), pričom zvyšok je kód poddielenej krajiny ISO 3166-2 v príslušnej krajine;
e) päť veľkých abecedných znakov zodpovedajúcich kódu UN/LOCODE oblasti, v ktorej sa nachádzajú, sú blízko alebo z ktorej sa skladajú lokalita(y) alebo oblasť(i);
f) spojenie, ktoré má dĺžku nie menej ako sedem a nie viac ako 35 znakov, z:
- kódu vydávajúcej agentúry ISO/IEC 15459;
- kódu lokality, ktorý sa skladá z znakov z množiny {A-Z; 0-9} a ktorý zodpovedá špecifikáciám dotknutej vydávajúcej agentúry.

