Identifikátor zariadenia, jedinečný globálny identifikátor pre zariadenie, položku vybavenia alebo inštanciu počítačovej aplikácie používanú pri výrobe, transporte, spracovaní alebo inom zaobchádzaní s položkami, ktorý sa vytvára konkatenáciou:
 - kód vydávajúcej agentúry ISO/IEC 15459;
 - číslo zariadenia, ktoré zodpovedá špecifikáciám príslušnej vydávajúcej agentúry; a že:
 - obsahuje iba veľké písmená abecedy a/alebo číselné znaky;
