Identifikátor zariadenia, jedinečný globálny identifikátor pre zariadenie, položku vybavenia alebo inštanciu počítačovej aplikácie používanú pri výrobe, transporte, spracovaní alebo inom zaobchádzaní s položkami.

Kód polohy UPU, kód identifikujúci miesto alebo geografickú oblasť, alebo pridruženú skupinu takýchto miest alebo oblastí, ktorá má význam pre súvisiacu transakciu a ktorá spĺňa jednu zo štruktúr definovaných v a) až g) nižšie:
a) dve veľké abecedné znaky zodpovedajúce dvojpísmennému kódu krajiny ISO 3166-1 krajiny, v ktorej sa nachádzajú alebo z ktorej sa skladajú umiestnenia alebo oblasti;
b) tri veľké abecedné znaky zodpovedajúce kódu IATA letiska alebo mesta, v ktorom sa nachádzajú, sú blízko alebo z ktorého sa skladajú umiestnenia alebo oblasti;
c) štyri alebo viac znakov, z ktorých prvé tri zodpovedajú kódu krajiny ISO 3166-1 nasledované pomlčkou (-), zvyšok tvorí poštové smerovacie číslo v príslušnej krajine;
d) štyri alebo viac znakov, z ktorých prvé tri zodpovedajú kódu krajiny ISO 3166-1 nasledované bodkou (.), zvyšok tvorí kód poddielov krajiny ISO 3166-2 v príslušnej krajine;
e) päť veľkých abecedných znakov zodpovedajúcich kódu UN/LOCODE oblasti, v ktorej sa nachádzajú, sú blízko alebo z ktorej sa skladajú umiestnenia alebo oblasti;
f) šesť veľkých alfanumerických znakov zodpovedajúcich kódu IMPC UPU prideleného v súlade so štandardom UPU S34;
g) konkatenácia, ktorá má dĺžku nie menej ako sedem ani viac ako 25 znakov, z:
 - kódu vydavateľa prideleného v súlade so štandardmi UPU S31;
 - kódu umiestnenia, ktorý sa skladá zo znakov z množiny {A-Z; 0-9}, ktorý zodpovedá špecifikáciám príslušného vydavateľa.

Špz s údajmi o službe a kódom polohy je zložená dátová štruktúra, v súlade so špecifikáciou v štandarde UPU S25, ktorá zahŕňa špecifikáciu:
 - identifikátora položky kompatibilného s ISO/IEC 15459;
 - špecifikácie identifikátora údajov 5U služby, ktorá má byť poskytnutá vzhľadom na položku;
 - identifikátora údajov 17U kompatibilného kódu polohy UPU alebo identifikátora údajov 18U kompatibilného kvalifikovaného kódu polohy UPU.
 Poznámka - Pre ďalšie podrobnosti sa odkazuje na štandard UPU S25. Rozdiel medzi jednoduchým kódom polohy UPU (DI 17U) a kvalifikovaným kódom polohy UPU (DI 18U) možno určiť z prvého znaku. Ak je číselný, platí 18U; ak je abecedný, platí 17U.

