Dátum, vyjadrený v modifikovanej forme kompatibilnej s UTC:
yyyy[mm[dd[hh[mm[ss[fff]]]]]][poooo], kde hranaté zátvorky označujú voliteľnosť a yyyy je rok, mmdd mesiac a deň, hhmmss čas dňa v hodinách minútach a sekundách, fff zlomky sekúnd a poooo posun od UTC vyjadrený v hodinách a minútach, posun je kladný, ak p je bodka (.), záporný, ak P je mínus (-).
PRÍKLAD:
2005 - (UTC) kalendárny rok 2005;
200505 - (UTC) kalendárny mesiac máj 2005;
20050518 - (UTC) 18. máj 2005;
200505181247 - 12:47 UTC 18. mája 2005;
200505181247.0100 - 12:47 miestneho času, čo je 11:47 UTC, 18. mája 2005;
20050518124723099 - 99 milisekúnd po 12:47:23 UTC 18. mája 2005.

