- dátumu, ktorého formát a interpretácia sú v súlade so špecifikáciami danej vydávajúcej agentúry pre daný kvalifikátor dátumu.

Vyhlásenie o kategórii, kóde a hmotnosti balení pre daný materiál použitý v danom balení podľa smernice EÚ o obaloch a obalovom odpade. (Kategória materiálu a kód definované v prílohe M).
12ECCMMMMMMNNNNNUU kde: - '12E' (an3) je identifikátor údajov;
 - 'CC' (n2) je kategória materiálu podľa prílohy M;
 - 'MMMMMM' (an1...6) je kód materiálu podľa prílohy M;
 - 'NNNNN' (n5) hmotnosť materiálu, vrátane desatinnej čiarky (napr. 12.12);
 - 'UU' (an2) je jednotka merania hmotnosti (napr. KG, GR, LB alebo OZ podľa ANSI X12.3 ako v prílohe D).

