Číslo príjemcu.
Jedinečné identifikačné číslo môže byť IRS, EIN, SSN alebo číslo pridelené CBP, ako sa vyžaduje pri Bezpečnostnom vyhlásení. Používajú sa iba nasledujúce formáty: IRS EIN: NN-NNNNNNN;
IRS EIN s príponou:
NN-NNNNNNNXX;
SSN: NNN-NN-NNNN;
CBP pridelené č.: YYDDPP-NNNNN.
